import './ExpensesFilter.css';
import { useState } from 'react';

const ExpensesFilter = (props) => {

    const [ y22 , setYear22 ] = useState(2022)
    const [ y21 , setYear21 ] = useState(2021)
    const [ y20 , setYear20 ] = useState(2020)
    const [ y19 , setYear19 ] = useState(2019)

    const clickHandler = (event) => {
      setYear(event.target.value)
      console.log(setYear)
    }
    
  return (
    <div className='expenses-filter'>
      <div className='expenses-filter__control'>
        <label>Filter by year</label>
        <select onClick={clickHandler}>
          <option value={2022}>{y22}</option>
          <option value={2021}>{y21}</option>
          <option value={2020}>{y20}</option>
          <option value={2019}>{y19}</option>
        </select>
      </div>
    </div>
  );
};

export default ExpensesFilter;
